import React, { Component } from 'react'

import Container from '@material-ui/core/Container';

class Home extends Component {
    constructor() {
        super()
        this.routeProfile = this.routeProfile.bind(this);
        this.routeContact = this.routeContact.bind(this);
        this.routePortfolio = this.routePortfolio.bind(this);
    }
    routeProfile() {
        let path= '/profile';
        this.props.history.push(path);
    }

    routeContact() {
        let path= '/contact'
        this.props.history.push(path)
    }

    routePortfolio() {
        let path= '/portfolio'
        this.props.history.push(path);
    }
    render() {
        return (
<Container>
                <h1>Welcome to my Portfolio. Please select one of the buttons below:</h1>
                <Box

                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                                height: 50,
                            }}
                            onClick={this.routeProfile}
                        >Profile</Box>
                <Button type="submit"
                            // disabled={!isEnabled}
                            className="btn btn-lg btn-primary btn-block"
                            waves="light"
                            node="a"
                            large
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                                height: 50,
                            }}
                            onClick={this.routeContact}
                        >Contact</Button>
                <Button type="submit"
                            // disabled={!isEnabled}
                            className="btn btn-lg btn-primary btn-block"
                            waves="light"
                            node="a"
                            large
                            style={{
                                width: '100%',
                                textAlign: "center",
                                justifyContent: "center",
                                height: 50,
                            }}
                            onClick={this.routePortfolio}
                >Portfolio</Button>
            </Container>
        )
    }
}

export default Home;
